from base64 import b64encode
from PySide6.QtCore import QByteArray
from PySide6.QtGui import QPixmap, QIcon

ICON_DEL = b''

ICON_PIN = b''

ICON_RECT = b''

ICON_RES = b''

ICON_SIM = b''

ICON_VSRC = b''

ICON_WIRE = b''

def getBase64(png):
    with open(png, 'rb') as img:
        print(b64encode(img.read()))

def getIcon(key):
    if key == 'del':
        data = ICON_DEL
    elif key == 'pin':
        data = ICON_PIN
    elif key == 'rect':
        data = ICON_RECT
    elif key == 'res':
        data = ICON_RES
    elif key == 'sim':
        data = ICON_SIM
    elif key == 'vsrc':
        data = ICON_VSRC
    elif key == 'wire':
        data = ICON_WIRE
    else:
        data = b''

    data = QByteArray.fromBase64(data)
    pixmap = QPixmap()
    pixmap.loadFromData(data)
    return QIcon(pixmap)